import { useContext, useEffect, useState } from "react"
import { UserContext } from "../../Context/UserContext"
import { GroupContext } from "../../Context/GroupContext"
import { Loading } from "../Loading/Loading";
import { Header } from "../Header/Header";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowLeft } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from "react-router-dom";
import "./Teacher.scss";
import { Group } from "./Groups/Group";
import { Homeworks } from "./Homeworks/Homeworks";
import { ActiveLesson } from "./ActiveLesson/ActiveLesson";
import { Materials } from "./Materials/Materials";

export const Teacher = () => {
    const { user } = useContext(UserContext)
    const { group, setGroup } = useContext(GroupContext)
    const [ loading, setLoading ] = useState(false)
    const [ selectedItem, setselectedItem ] = useState(1)
    const navigation = useNavigate()

    const GoBack = () => {
        navigation('/')
    }

    useEffect(() => {        
        if (!user) {
            navigation('/');
        }
    }, [user, navigation]);


    return(
        <div>
            <Header></Header>        
            <div className="teacher">     
                <FontAwesomeIcon icon={faArrowLeft} className="arrow" onClick={GoBack}/>       
                <div className="teacher__right">                
                    <div className="teacher__right__item">Групи</div>
                    <div className="teacher__right__item">Домашнє завдання</div>
                    <div className="teacher__right__item">Відкриті уроки</div>
                    <div className="teacher__right__item">Матеріали</div>
                </div>
                <div className="teacher__left">
                    {}
                </div>
            </div>        
        </div>    
    )
}
